import Star = require("star");
import C = require("const");
import Rumia = require("rumia");
import IGameImage = require("iGameImage");

class StarControl {
    private ctx: CanvasRenderingContext2D;
    private image: IGameImage;
    private starList: Array<Star>;
    private span: Span;
    private count: number;

    constructor(ctx: CanvasRenderingContext2D, image: IGameImage) {
        this.image = image;
        this.ctx = ctx;
        this.starList = new Array(C.STAR_MAX);
    };

    public init = (): void=> {
        this.span = new Span(this.addStar);
        this.count = 0;
        for (var i: number = 0; i < C.STAR_MAX; i++) {
            this.starList[i] = new Star(this.ctx, this.image);
        }
    };

    public calc = (): void => {
        if (this.count % 2080 == 0) this.span.init();
        this.span.calc();
        for (var i = 0; i < C.STAR_MAX; i++) {
            this.starList[i].calc();
        }

        this.count++;
    };

    public graph = (): void => {
        for (var i = 0; i < C.STAR_MAX; i++) {
            this.starList[i].graph();
        };
    };

    public interferenceRumia = (rumia: Rumia): void => {
        for (var i = 0; i < C.STAR_MAX; i++) {
            if (rumia.isHittingStar(this.starList[i])) {
                this.starList[i].onHit(rumia);
                break;
            }
        }
    };

    private addStar = (large: boolean, x: number, y: number, shooting: boolean = false): void=> {
        for (var i: number = 0; i < C.STAR_MAX; i++) {
            if (!this.starList[i].isFlag()) {
                this.starList[i].init(large, x, y, shooting);
                break;
            }
        }
    };
}
export = StarControl;

