    public calc = (): void => {
        if (this.count >= 1680) return;
        if (this.time >= 20 && this.count % (this.time < 39 ? (400 - this.time * 10) : 20) == 0) {
            this.addStar(false, 58 + (Math.random() * 480), 48, true);
        }
        if (this.count % 240 == 0) {
            this.currentPattern++;
        }
        if (this.count % 24 == 0) {
            var x: number = (this.count % 240) / 24;
            for (var y: number = 0; y < 14; y++) {
                switch (this.patternList[this.difficulty][this.patterns[this.currentPattern]][x][y]) {
                    case 1:
                        this.addStar(false, 492, (24 * y) + 84);
                        break;
                    case 2:
                        this.addStar(true, 504, (24 * y) + 96);
                        break;
                }
            }
        }
        this.count++;
    };
